    // Load states into stateSelect
    for (const state in data) {
        const option = document.createElement('option');
        option.value = state;
        option.textContent = state;
        stateSelect.appendChild(option);
    }

    stateSelect.addEventListener('change', function() {
        citySelect.innerHTML = '';
        zipcodeSelect.innerHTML = ''; // Clear city and zipcode dropdowns when state changes
        const cities = data[stateSelect.value];
        for (const city in cities) {
            const option = document.createElement('option');
            option.value = city;
            option.textContent = city;
            citySelect.appendChild(option);
        }
        citySelect.dispatchEvent(new Event('change')); // Automatically trigger city change event
    });

    citySelect.addEventListener('change', function() {
        zipcodeSelect.innerHTML = '';
        const zipcodes = data[stateSelect.value][citySelect.value];
        if (zipcodes) {
            zipcodes.forEach(zipcode => {
                const option = document.createElement('option');
                option.value = zipcode;
                option.textContent = zipcode;
                zipcodeSelect.appendChild(option);
            });
        }
    });

    form.addEventListener('submit', function(event) {
        event.preventDefault();
        
        const selectedZipcode = zipcodeSelect.value;
        const selectedCity = citySelect.value;
        const selectedState = stateSelect.value;

    

        // Redirect to the output.html page with the selected location as a query parameter
        const url = `/search/${selectedState}/${selectedCity}/${selectedZipcode}`;
        window.location.href = url;
    });

    stateSelect.dispatchEvent(new Event('change')); // Automatically load initial cities and zipcodes
